 @RequestMapping(value="printidcard",method=RequestMethod.POST)
 public String printidcard(@RequestBody String params, @Context HttpServletRequest request) throws Exception{
     JSONObject json = JSON.parseObject(params);
     JsonUtils.checkUserAuth(json.getString("token"));
     JSONObject obj = (JSONObject) json.get("params");
     JSONObject dataJson = new JSONObject();
     String certnum = obj.getString("certnum");
     String name = obj.getString("name");
     try {
        Map<String, String> post = getgongandetail(certnum, name);
        if("1".equals(post.get("success"))){
            String username = post.get("name");
            String address = post.get("address");
           
            String sex = post.get("sex");
            String birthyear = post.get("year");
            String birthmonth = post.get("month");
            String birthday = post.get("date");
            String folk = post.get("nation");
            String valid = post.get("yxq");
            String agency = post.get("org");
            Map<String, String> imgpost = getgonganphoto(certnum);
            String photobuf = "";
            if("1".equals(imgpost.get("success")))     {    
            String licenseName = ClassPathUtil.getClassesPath() + "license.xml";
            License license = new License();
            photobuf =  imgpost.get("photo");
            String idcard = imgpost.get("idcard");
            try {
                license.setLicense(licenseName);
                FontSettings.setFontsFolder(ClassPathUtil.getClassesPath() + "font" + File.separator, true);
            } catch (Exception e) {
                log.error(e.toString());
            }

            String doctem = QueueCommonUtil.getUrlPath(request.getRequestURL().toString())
                    + "/jiningzwfw/individuation/overall/selfservicemachine/idcardcopy/sfz.docx";
            Document doc = new Document(doctem);
            String[] fieldNames = null;
            Object[] values = null;
            Map<String, String> map = new HashMap();
            map.put("n", username);
            map.put("address", address);
            map.put("idcard", idcard);
            map.put("s", sex);
            map.put("y", birthyear);
            map.put("m", birthmonth);
            map.put("d", birthday);
            map.put("f", folk);
            map.put("valid", valid);
            map.put("agency", agency);
            fieldNames = new String[map == null ? 0 : map.size()];
            values = new Object[map == null ? 0 : map.size()];
            int num = 0;

            for (Entry<String, String> entry : map.entrySet()) {
                fieldNames[num] = entry.getKey();
                values[num] = entry.getValue();
                num++;
            }

            doc.getMailMerge().execute(fieldNames, values);
            byte[] pic = Base64Util.decodeBuffer(photobuf.replace("data:image/png;base64,", ""));
            InputStream input = new ByteArrayInputStream(pic);
            if (input != null) {
                DocumentBuilder build = new DocumentBuilder(doc);
                build.moveToBookmark("photobuf");
                build.insertImage(input, 200.0D, 240.0D);
            }

            ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
            doc.save(outputStream, 10);
            ByteArrayInputStream inputStream = new ByteArrayInputStream(outputStream.toByteArray());
            long size = (long) inputStream.available();
            FrameAttachInfo frameAttachInfo = new FrameAttachInfo();
            frameAttachInfo.setCliengGuid(UUID.randomUUID().toString());
            frameAttachInfo.setAttachFileName("身份证正反.doc");
            frameAttachInfo.setCliengTag("身份证复印");
            frameAttachInfo.setUploadUserGuid("");
            frameAttachInfo.setUploadUserDisplayName("");
            frameAttachInfo.setUploadDateTime(new Date());
            frameAttachInfo.setContentType("application/msword");
            frameAttachInfo.setAttachLength(size);
            dataJson.put("docattachguid", attachservice.addAttach(frameAttachInfo, inputStream).getAttachGuid());
            outputStream.close();
            inputStream.close();
            return JsonUtils.zwdtRestReturn("1", "获取附件成功！", dataJson);
            }else{
                return JsonUtils.zwdtRestReturn("0", "获取附件失败！"+imgpost.get("msg"), "");
            }
        }
        else {
            return JsonUtils.zwdtRestReturn("0", "获取附件失败！"+post.get("msg"), "");
        }
    }
    catch (IOException e) {
        // TODO Auto-generated catch block
        e.printStackTrace();
        return JsonUtils.zwdtRestReturn("0", "获取附件失败！", "");
    }
    catch (DocumentException e) {
        // TODO Auto-generated catch block
        e.printStackTrace();
        return JsonUtils.zwdtRestReturn("0", "获取附件失败！", "");
    }
 }
 
